Defendant Jasmine M Meeks in court with attorney Jamie Francis Cimpl-Wiemer.  
Patrick J Anderson appeared for the State of Wisconsin.  
Deputy Court Clerk: dds.

Amended Information received and filed.  Defense counsel waived reading of the Amended Information.

Charge amended to COUNT 1:  BATTERY, contrary to Wisconsin Statutes section(s) 940.19 (1), a Class A Misdemeanor

Defendant prepared to enter change of plea.  Hearing proceeded.  Negotiations set forth by the state.

The defendant was advised of her constitutional rights and maximum penalties, waived all rights, plead GUILTY and was examined as to the plea.  Plea Questionnaire/Waiver of Rights, Addendum to Plea Questionnaire, and Jury Instructions received and filed.  The parties stipulate to the complaint as a factual basis for the plea.  The Court found the defendant guilty and ordered entry of Judgment of Conviction.  

Sentencing proceeded.  Statements made by the state, defense, and defendant.

The Court ordered the defendant to serve 4 MONTHS in the House of Correction with 1 day credit; first 2 MONTHS STRAIGHT TIME; balance at the discretion of the House of Correction.  

This sentence is STAYED and the defendant is placed on probation for 1 YEAR with the following conditions:

-Serve 3 days in the House of Correction- STAYED for use at agent discretion;
- AODA assessment and cooperate with any programs deemed necessary by agent.;
- Random urine screens if deemed appropriate by agent;
- Obtain/maintain employment/ education/vocation; in any combination equaling full-time hours;
- No contact with: Russell H.- if attending Bradley Tech High School must stay 100 feet away from the victim;
-Obtain evaluation to determine if anger management is deemed appropriate;
- Follow all rules of supervision and follow through with any other treatment deemed necessary by the department;

Court ordered the defendant pay all of the following by the end of supervision;  Failure to pay will result in a civil judgment:
All court costs, fees, and surcharges (including DNA)-agent to set payment plan; 
All applicable fees of supervision.

Restitution set at zero.  Defense motion for expungement heard and denied by the Court.  Court advised defendant of her right to seek postconviction relief.
